    public static boolean isIsomorphic(String s, String t) {
        if (s.length() != t.length()) {
            return false;
        }
        char[] sChsr = s.toCharArray();
        char[] rChar = t.toCharArray();
        Map map = new HashMap<>();
        Map map2 = new HashMap<>();
        for(int i=0;i<sChsr.length;i++) {
            if (map.put(sChsr[i], i) != map2.put(rChar[i], i)) {
                System.out.println(map2.put(rChar[i], i));
                System.out.println(map.put(sChsr[i], i));
                System.out.println(sChsr[i]);
                System.out.println(rChar[i]);
                System.out.println(i);
                return false;
            }
        }
        return true;
    }

